import{_ as e,c as t,o as a,a3 as p}from"./chunks/framework.DWT__QHq.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"Notes/12_weixin/13-上线发布.md","filePath":"Notes/12_weixin/13-上线发布.md"}'),o={name:"Notes/12_weixin/13-上线发布.md"},_=p('<h2 id="上线发布" tabindex="-1">上线发布 <a class="header-anchor" href="#上线发布" aria-label="Permalink to &quot;上线发布&quot;">​</a></h2><p>假设我们目前已经使用微信开发者工具，按照小程序的开发规范完成了小程序的全部的全部开发工作，并且完成了本地测试，</p><p>这时候我们需要开发对小程序进行发布，小程序上线的流程如下：</p><p><img src="http://8.131.91.46:6677/mina/base/%E5%B0%8F%E7%A8%8B%E5%BA%8F%E4%B8%8A%E7%BA%BF%E6%B5%81%E7%A8%8B.png" alt=""></p><p>开发版本：点击开发者工具上传后的版本，开发版本只保留每人最新的一份上传的代码，是供开发者和团队测试和调试的版本</p><p>体验版本：小程序开发者可以将开发版本转换为体验版本，由测试人员以及产品经理进行测试与体验，确认没问题可提交审核</p><p>审核版本：小程序开发者可以将开发版本转换为审核版本，由微信的审核团队进行审核，审核周期为1~7天，审核通过可提交发布</p><p>线上版本：通过微信小程序平台审核，并由开发者提交发布的正式版本，线上版本是用户可以正常使用的小程序版本</p><p>小程序开发成员在开发者工具中点击 <strong><code>上传</code></strong> 按钮，在弹出的界面中选择更新类型、版本号、项目备注，就能够将小程序代码上传至微信公众号后台审核。</p><p><img src="http://8.131.91.46:6677/mina/base/%E5%B0%8F%E7%A8%8B%E5%BA%8F%E4%B8%8A%E7%BA%BF.jpg" alt=""></p><p>在登录到微信公众后台以后，点击左侧的 <code>管理</code> ➡ <code>版本管理</code>，就能查看小程序的四个个版本</p><p><img src="http://8.131.91.46:6677/mina/base/%E5%B0%8F%E7%A8%8B%E5%BA%8F%E4%B8%8A%E7%BA%BF%E6%AD%A5%E9%AA%A4.jpg" alt=""></p>',12),s=[_];function c(n,i,r,d,B,A){return a(),t("div",null,s)}const m=e(o,[["render",c]]);export{l as __pageData,m as default};
